<template>
  <div class="content_view">
    <terminal-info :terminalInfo="terminalInfo"/>
    <div style="padding-top: 20px">
      <div class="goods_cell">
        <a class=" logo">
        </a>
      </div>
      <div v-for="(goods,index) in goodsList" v-bind:key="goods.productId" class="goods_cell "
           @click="toGoodsDetail(goods)">

        <div :class="(index+1)%2==0?'goods_item_left' :'goods_item_right'">
          <img src="/images/item_bg.png" @load="imageLoaded" class="item_bg" mode="widthFix">
          <a class="goods_no">
            {{index+1}}
          </a>
          <img mode="widthFix" class="goods_image fadeInOut" :src="imageDomain+goods.productPicURLs"/>
          <a class="goods_name">
            {{goods.productName}}
          </a>
        </div>
      </div>

    </div>

  </div>

</template>

<script>
    import env from '../../../../env.js'

    export default {
        data() {
            return {
                imageDomain: env.globalData.imageDomain,
                goodsList: [],
                title: '首页',
                terminalInfo:'',
                menus: [{
                    name: '全部商品',
                    isSelected: true
                },
                    {
                        name: 'Best 10',
                        isSelected: false
                    },
                    {
                        name: '最近流行',
                        isSelected: false
                    },
                    {
                        name: 'Smart',
                        isSelected: false
                    }],
                bgCount: 0

            }

        },

        components: {
//      headerTitle,
//            terminalInfo
        },

        methods: {
            imageLoaded() {
                this.bgCount++
            },
            getGoodsList() {
                var that = this
                env.requestGet(env.ws.getProductListByDeviceId, { deviceId:that.terminalInfo.deviceId},
                    function (res, success) {
                        if (success) {
                            console.log(res)
                            that.goodsList  = res.data.resultValue
                        }
                        wx.hideLoading()
                        wx.stopPullDownRefresh()
                    })
            },
            selectMenu(selectedMenu) {
                this.menus.forEach(menu => {
                    menu.isSelected = (menu.name == selectedMenu.name);
                })
            },
            toGoodsDetail(goods) {
                wx.navigateTo({
                    url: '../detail/main?productId=' + goods.productId + '&productName=' + goods.productName
                })
            },
            getTerminalById(terminalId) {
                let that = this
                env.showLoading('加载中..')
                env.getTerminalListByDeviceId(terminalId, function (res, success) {
                    if (success) {
                        that.terminalInfo =env.parseJson(res.data.resultValue)
                        that.getGoodsList()
                    }else{
                        env.hideLoading()
                        env.showToastFail(res.data.resultDesc+",正在跳转...")
                        setTimeout(function(){
                            wx.redirectTo({
                                url: '../../lbs/terminal/main'
                            })
                        },1000)
                    }
                })

            }


        },


        mounted() {
            let terminalId = this.$root.$mp.query.terminalId
            this.getTerminalById(terminalId)

        },
        onPullDownRefresh: function () {
            this.getGoodsList()
        }
    }
</script>

